import org.junit.Test;

import java.util.Arrays;

import static org.hamcrest.CoreMatchers.is;
import static org.junit.Assert.assertThat;

public class FindAllAnagramsinaStringTest {

    FindAllAnagramsinaString fas = new FindAllAnagramsinaString();

    @Test
    public void test1() {
        assertThat(fas.findAnagrams("cbaebabacd", "abc"), is(Arrays.asList(0, 6)));
    }

    @Test
    public void test2() {
        assertThat(fas.findAnagrams("abab", "ab"), is(Arrays.asList(0, 1, 2)));
    }

    @Test
    public void test3() {
        assertThat(fas.findAnagrams("aaaaaaaaaaa", "aaaaaaaaaa"), is(Arrays.asList(0, 1)));
    }

    @Test
    public void test4() {
        assertThat(fas.findAnagrams("",
                ""),
                is(Arrays.asList(0, 10001)));
    }
}
